                insert_col = j
                break
        # insert character
        table[row][insert_col] = key[i]
        # update column if necessary
        if insert_col!= col:
            for j in range(5):
                if table[j][col] == "":
                    table[j][col] = table[j][insert_col]
                    table[j][insert_col] = ""
    # init ciphertext
    ciphertext = ""
    # append characters
    for i in range(len(stdin)):
        # find row and column
        row = i // 5
        col = i % 5
        # add character to ciphertext if valid
        if stdin[i] == " ":
            ciphertext += " "
        else:
            # find character in same row
            cipher_row = None
            for j in range(5):
                if table[row][j] == stdin[i]:
                    cipher_row = j
                    break
            # add character to ciphertext
            if cipher_row is not None:
                ciphertext += table[row][cipher_row]
            # find character in same column
            else:
                cipher_col = None
                for j in range(5):
                    if table[j][col] == stdin[i]:
                        cipher_col = j
                        break
                # add character to ciphertext
                if cipher_col is not None:
                    ciphertext += table[cipher_col][col]
                # find character in same rectangle
